using TopInterviewQuestions._03_Longest_Substring_Without_Repeating_Characters;
using Xunit;

namespace UnitTest.TopInterviewQuestions;

public class LongestSubstringWithoutRepeatingCharactersTest
{
    [Fact]
    public static void HowLongIsTheLongestSubstring()
    {
        Solution solution = new Solution();
        const string actual = "abcabcbb";
        Assert.Equal(3, solution.LengthOfLongestSubstring(actual));
        
        const string actual1 = "bbbbb";
        Assert.Equal(1, solution.LengthOfLongestSubstring(actual1));
        
        const string actual2 = "pwwkew";
        Assert.Equal(3, solution.LengthOfLongestSubstring(actual2));
        
        const string actual3 = "";
        Assert.Equal(0, solution.LengthOfLongestSubstring(actual3));
        
        const string actual4 = " ";
        Assert.Equal(1, solution.LengthOfLongestSubstring(actual4));
        
        const string actual5 = "c";
        Assert.Equal(1, solution.LengthOfLongestSubstring(actual5));
        
        const string actual6 = "au";
        Assert.Equal(2, solution.LengthOfLongestSubstring(actual6));
        
        const string actual7 = "aab";
        Assert.Equal(2, solution.LengthOfLongestSubstring(actual7));
        
        const string actual8 = "dvdf";
        Assert.Equal(3, solution.LengthOfLongestSubstring(actual8));

        const string actual9 = "aabaab!bb";
        Assert.Equal(3, solution.LengthOfLongestSubstring(actual9));

